import React, { useState } from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee } from '@fortawesome/free-solid-svg-icons'

function Navigation(){
    return(
        <nav>
            <span className="text-xl">
                <FontAwesomeIcon 
                icon = {faCoffee}
                />
            </span>

        </nav>
    )
}

export default Navigation
